// define OpenGL object IDs to represent the vertex array and the shader program in the GPU
// Object 0 = duck
// Object 1 = pool
GLuint duckVAO;
GLuint duckVBO;
GLuint poolVAO;
GLuint poolVBO;      
GLuint shader;      // combined vertex and fragment shader
GLuint tileTexture;


// called by the main function to do initial setup, such as uploading vertex
// arrays, shader programs, etc.; returns true if successful, false otherwise
bool setup()
{
    
    //OBJECT 1: DUCK
    glGenVertexArrays(1, &duckVAO);
    glGenBuffers(1, &duckVBO);

    glBindVertexArray(duckVAO);
    glBindBuffer(GL_ARRAY_BUFFER, duckVBO);

    glBufferData(GL_ARRAY_BUFFER, sizeof(duckVertices), duckVertices, GL_STATIC_DRAW);

    glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 11 * sizeof(float) + sizeof(int), (void*) 0);
    glVertexAttribPointer(1, 3, GL_FLOAT, GL_FALSE, 11 * sizeof(float) + sizeof(int), (void*) (3 * sizeof(float)));
    glVertexAttribPointer(2, 3, GL_FLOAT, GL_FALSE, 11 * sizeof(float) + sizeof(int), (void*) (6 * sizeof(float)));
    glVertexAttribPointer(3, 2, GL_FLOAT, GL_FALSE, 11 * sizeof(float) + sizeof(int), (void*) (9 * sizeof(float)));
    glVertexAttribIPointer(4, 1, GL_INT, 11 * sizeof(float) + sizeof(int), (void*) (11 * sizeof(float)));

    glEnableVertexAttribArray(0);
    glEnableVertexAttribArray(1);
    glEnableVertexAttribArray(2);
    glEnableVertexAttribArray(3);
    glEnableVertexAttribArray(4);

    //OBJECT 2: POOL
    glGenVertexArrays(1, &poolVAO);
    glGenBuffers(1, &poolVBO);

    glBindVertexArray(poolVAO);
    glBindBuffer(GL_ARRAY_BUFFER, poolVBO);

    glBufferData(GL_ARRAY_BUFFER, sizeof(poolVertices), poolVertices, GL_STATIC_DRAW);

    glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 11 * sizeof(float) + sizeof(int), (void*) 0);
    glVertexAttribPointer(1, 3, GL_FLOAT, GL_FALSE, 11 * sizeof(float) + sizeof(int), (void*) (3 * sizeof(float)));
    glVertexAttribPointer(2, 3, GL_FLOAT, GL_FALSE, 11 * sizeof(float) + sizeof(int), (void*) (6 * sizeof(float)));
    glVertexAttribPointer(3, 2, GL_FLOAT, GL_FALSE, 11 * sizeof(float) + sizeof(int), (void*) (9 * sizeof(float)));
    glVertexAttribIPointer(4, 1, GL_INT, 11 * sizeof(float) + sizeof(int), (void*) (11 * sizeof(float)));

    glEnableVertexAttribArray(0);
    glEnableVertexAttribArray(1);
    glEnableVertexAttribArray(2);
    glEnableVertexAttribArray(3);
    glEnableVertexAttribArray(4);

    tileTexture = gdevLoadTexture("tiles.jpg", GL_REPEAT, true, true);
    if (! tileTexture) return false;


    shader = gdevLoadShader("exer4.vs", "exer4.fs");
    if (! shader)
        return false;
    return true;
}

glm::vec3 eyePosition = glm::vec3(0.0f, 0.0f, -5.0f);
glm::vec3 targetPosition = glm::vec3(0.0f, 0.0f, 5.0f);
glm::vec3 upVector = glm::vec3(0.0f, 1.0f, 0.0f);

glm::vec3 duckPositions[] = {
    glm::vec3( 0, 0, 0), 
    glm::vec3( -1.0, -1.0, -1.0), 
    glm::vec3( 1.0, 1.0, 1.0),  
};

// called by the main function to do rendering per frame
void render()
{
    glClearColor(0.0f, 0.1f, 0.1f, 1.0f);
    glClear(GL_COLOR_BUFFER_BIT | GL_DEPTH_BUFFER_BIT);
    glEnable(GL_CULL_FACE);
    glEnable(GL_DEPTH_TEST);
    glUseProgram(shader);


    // TEXTURE
    glActiveTexture(GL_TEXTURE0);
    glBindTexture(GL_TEXTURE_2D, tileTexture);
    glUniform1i(glGetUniformLocation(shader, "marbleTexture"), 0);
    
    float time = glfwGetTime();

    glm::mat4 model;
    glm::mat4 projView;
    glm::mat4 normal;

    float angle = glfwGetTime()*60;
    glm::vec3 axes[] = {
        glm::vec3(1.0f, 0.0f, 0.0f),
        glm::vec3(0.0f, 1.0f, 0.0f),
        glm::vec3(0.0f, 0.0f, 1.0f),
    };
    
    glm::vec3 scales[] = {
        glm::vec3(0.5f, 0.5f, 0.5f),
        glm::vec3(0.7f, 0.7f, 0.7f),
        glm::vec3(0.9f, 0.9f, 0.9f),
    };
    glm::mat4 viewTransform = glm::lookAt(eyePosition, targetPosition + eyePosition, upVector);

    //RENDER THE DUCKS
    glBindVertexArray(duckVAO);
    for(unsigned int i = 0; i < 3; i++) {
        projView = glm::perspective(glm::radians(60.0f),
                                (float) WINDOW_WIDTH / WINDOW_HEIGHT,
                                0.1f,
                                100.0f);

        projView *= viewTransform;
    
        model = glm::translate(glm::mat4(1.0), duckPositions[i]);
        model = glm::rotate(model, glm::radians(angle), axes[i]);
        model = glm::scale(model, scales[i]);
        
        normal = glm::transpose(glm::inverse(model));
        
        glUniformMatrix4fv(glGetUniformLocation(shader, "model"), 1, GL_FALSE, glm::value_ptr(model));
        glUniformMatrix4fv(glGetUniformLocation(shader, "projView"), 1, GL_FALSE, glm::value_ptr(projView));
        glUniformMatrix4fv(glGetUniformLocation(shader, "normal"), 1, GL_FALSE, glm::value_ptr(normal));

        glDrawArrays(GL_TRIANGLES, 0, sizeof(duckVertices) / (3 * sizeof(float)));
    }


    //RENDER THE POOL
    glBindVertexArray(poolVAO);
    projView = glm::perspective(glm::radians(60.0f),
                            (float) WINDOW_WIDTH / WINDOW_HEIGHT,
                            0.1f,
                            100.0f);
    projView *= viewTransform;
    model = glm::mat4(1.0);
    normal = glm::transpose(glm::inverse(model));
    glUniformMatrix4fv(glGetUniformLocation(shader, "model"), 1, GL_FALSE, glm::value_ptr(model));
    glUniformMatrix4fv(glGetUniformLocation(shader, "projView"), 1, GL_FALSE, glm::value_ptr(projView));
    glUniformMatrix4fv(glGetUniformLocation(shader, "normal"), 1, GL_FALSE, glm::value_ptr(normal));
    glDrawArrays(GL_TRIANGLES, 0, sizeof(duckVertices) / (3 * sizeof(float)));


    //LIGHT SHENANIGANS
    glm::vec3 lightPos = glm::vec3(7.0 * cos(time/3.0),7.0f * sin(time/4.0),7.0 * sin(time/3.0));
    glm::vec3 lightColor = glm::vec3((sin(time)+1.0)/2.0,(sin(time+6.28/3.0)+1.0)/2.0,(sin(time+12.57/3.0)+1.0)/2.0);
    glUniform3fv(glGetUniformLocation(shader, "lightPos"), 1, glm::value_ptr(lightPos));
    glUniform3fv(glGetUniformLocation(shader, "lightColor"), 1, glm::value_ptr(lightColor));
    glUniform3fv(glGetUniformLocation(shader, "eyePosition"), 1, glm::value_ptr(eyePosition));
    glUniform1f(glGetUniformLocation(shader, "time"), time);
}

